// Sidebar.js

import React, { useContext, useState } from 'react';
import './Sidebar.css';
import { media } from '../../media/media';
import { NavLink } from 'react-router-dom';
import { Context } from '../../Context/Context';

const Sidebar = () => {
    const [extended, setExtended] = useState(true);
    const{onSent,prevPrompts,setRecentPrompt} = useContext(Context)



    const containerStyle = {
      width: extended ? '16%' : '6%',
    };

    const fontSizeStyle = {
      fontSize: extended ? '' : '20px',
    };
    const newchat = {
      borderRadious: extended? '' : '50px',
      height: extended? '' : '40px',
      width: extended? '' : '40px',
    }
    const fLogo = {
      height: extended? '' : '40px',
      width: extended? '' : '40px',
    }
    const menu = {
        position: extended? '' : 'absolute',
        bottom: extended? '' : '80px',
        left: extended? '' : '25px',
        padding: extended? '' : '0',
        height: extended? '' : '30px',
        width: extended? '' : '30px',
        fontSize: extended? '' : '16px',
        lineHeight: extended? '' : '30px',
    }

      
    return (
        <div className="sidebar" style={containerStyle}>
            <div className="top">
                <div className="logo">
                    <img src={media.logo} alt="logo" />
                    {extended ? <h1>perplexity</h1> : null}
                    <i style={menu} className={`fa-light menu ${extended ? 'fa-arrow-left-to-line' : 'fa-arrow-right-to-line'}`} onClick={() => setExtended(prev => !prev)}></i>
                </div>
                <div className='block'>
                    <div className="new-chat" style={newchat}>
                        <p><i className="fa-light fa-plus" style={fontSizeStyle}></i></p>
                        {extended ? 
                        <div className='kbg-tag'>
                            <kbd>Ctrl</kbd>
                            <kbd>I</kbd>
                        </div>
                        : null}
                    </div> 
                </div>
                <div className='sidebar-menu'>
                    <ul>
                        <li>
                            <NavLink to="/">
                                <i className="fa-light fa-magnifying-glass" style={fontSizeStyle}></i>
                                {extended ? <p>Home</p> : null}
                            </NavLink>
                        </li>
                        <li>
                            <NavLink to="/Discover">
                                <i className="fa-light fa-compass" style={fontSizeStyle}></i>
                                {extended ? <p>Discover</p> : null}
                            </NavLink>
                        </li>
                        <li>
                            <NavLink to="/Library">
                                <i className="fa-light fa-rectangle-vertical-history" style={fontSizeStyle}></i>
                                {extended ? <p>Library</p> : null}
                            </NavLink>
                        </li>
                    </ul>
                </div>
                {extended ? 
                <div className='recent-menu'>
                    <ul>
                        {prevPrompts.map(() =>{
                            
                        })}
                        <li>
                            <a href="">
                                <p>What do you know..</p>
                                <i className="fa-light fa-layer-group"></i>
                            </a>
                        </li>
                    </ul>
                </div> : null}
                {extended ? 
                <div className='menu-upgrade'>
                    <a href="">Try Pro</a>
                    <p>Upgrade for image upload, smarter AI, and more Pro Search.</p>
                    <button>
                        <i className="fa-light fa-arrow-up-right"></i>
                        <span>Learn More</span>
                    </button>
                </div> : null}
            </div>
            <div className="bottom">
                <div className='client-detail'>
                    <img src={media.client} alt=""  style={fLogo} />
                    {extended ? <p>zahidalicodes</p> : null}
                    {extended ? <i className="fa-light fa-gear"></i> : null}
                </div>
            </div>
            {extended ?
            <div className='bottom-2'>
                <div className='social-links'>
                    <div className='download'>
                        <a href="">
                            <i className="fa-light fa-mobile"></i>
                            <span>Download</span>
                        </a>
                    </div>
                    <div className='social-icons'>
                        <a href="">
                            <i className="fa-brands fa-x-twitter"></i>
                        </a>
                        <a href="">
                            <i className="fa-brands fa-discord"></i>
                        </a>
                    </div>
                </div>
            </div> : null}
            
        </div>
    );
};

export default Sidebar;
